
use health;

CREATE TABLE `states_averages` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `state_name` varchar(32) NOT NULL,
  `waiting_time` varchar(32) DEFAULT NULL,
  `time_until_sent_home` varchar(32) DEFAULT NULL,
  `broken_bone` varchar(32) DEFAULT NULL,
  `transfer_time` varchar(32) DEFAULT NULL,
  `hospital_name` varchar(255) DEFAULT NULL,
  `hospital_link` varchar(255) DEFAULT NULL,
  `phone` varchar(32) DEFAULT NULL,
  `address` varchar(255) DEFAULT NULL,
  `g_address` varchar(255) DEFAULT NULL,
  `g_lat` varchar(255) DEFAULT NULL,
  `g_lng` varchar(255) DEFAULT NULL,
  `g_place_id` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4938 DEFAULT CHARSET=latin1;

